import React from 'react';
import './App.css';

function Page5() {
  return (
    <div className="App">
      <div className="welcome-message5">Tebrikler!</div>
      <p>Formu başarıyla tamamladınız.</p>
      <p>Katılımınız için teşekkür ederiz.</p>
    </div>
  );
}

export default Page5;
